function App() {
  return (
    <React.Fragment>
      <Compo>
        <Nav />
        <Route exact path="/" component={HomeMain} />
        <Route path="/countries" component={Countries} />
        <Route path="/country/:id" component={CountryDetail} />
      </Compo>
    </React.Fragment>
  );
}

export default App;

const Compo = styled.div`
  h1 {
    text-align: center;
  }
`;
